import React from 'react';
import './App.css';  // Ini mengimpor Tailwind CSS yang sudah dihubungkan di App.css

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="text-4xl font-bold text-blue-600">Welcome to My App</h1>
        <p className="text-gray-600">Styled with Tailwind CSS</p>
      </header>
    </div>
  );
}

export default App;
